import { UserContext } from './Contexts/UserContext';

function App() {
  return (
    <Router>
        <Routes>
          <Route path="/" element={<Register/>}></Route>
          <Route path="/login" element={<Login/>}></Route>
          <Route path="/homepage" element={<Homepage/>}></Route>
          <Route path="/items" element={<Item/>}></Route>
        </Routes>
    </Router>
    // <div>
